import './App.css';
//import LoginApp from './Components/LoginSignUp/login';
//import LoginComponent from './Components/LoginSignUp/login';
import React,{useState} from 'react';

function App() {

     const[name,setname] = useState("subham")

     function handleInputChange(){
          setname("aman")
     }

     return ( 

      <div className='container'>

      <div className='header'>

          <div className='text'>

              LogIn
          </div>

          <div className='inputs'>

              <div className='input'>

                  <input value = 'userid' type='email' placeholder="Email Id"></input>

              </div>

              <div className='input'>

                  <input value = 'pass' type='password' placeholder="Password"></input>

              </div>

              <div className="submit-container">

                  <div className="submit">

                      <button onClick={handleInputChange}>login</button>

                  </div>
              </div>

              <p>{name}</p>

          </div>

         </div>
     </div>
  );
}

export default App;
